import { TextField } from "@material-ui/core";
import React from "react";

const Home = () => {
  return (
    <div>
      <div>
        <h2>Quiz Settings</h2>
      </div>
      <div>
      <TextField id="outlined-basic" label="Enter Name" variant="outlined" />
        <input type="text" placeholder="Categories" />
        <input type="text" placeholder="Level" />
      </div>
      <div>
          <img src="quiz.jpg"/>
      </div>
    </div>
  );
};

export default Home;
